        form:{
                "number": "",
                "validator": "",
                "name": "",
                "birthdate": "",
                "email": "",
                "code": "",
                "namerole": "",
                "last_name": "",
                "second_last_name": ""
                                    
        },
        error:false,
        errorMsg:""
    }


    manejadorChange = async e => {
      await this.setState({
          form:{
              ...this.state.form,
              [e.target.name]: e.target.value
          }
      })
   
}

manejadorSubmit = e => {
  e.preventDefault();
}




patch = () => {
  let UserEmail = this.props.match.params.id;
  let url = ApiurlUsers +  UserEmail; 
  axios.patch(url,this.state.form)
  .then( response =>{
    console.log(response)
  })
}

delete  = () =>{
  let userId = this.props.match.params.id;
  let url = ApiurlUsers +  userId; 
  let datos = {
    "userId" : userId
  }
 
   axios.delete(url,{headers:datos})
   .then (response =>{
      this.props.history.push("/dashboard");
   })
}

 
